<template>
  <view
    class="yh-navbar-wrapper"
    :style="navbarWrapperStyle"
    :class="fixed ? 'fixed' : ''"
  >
    <view class="yh-navbar" :class="picker ? 'picker' : ''">
      <template v-if="!picker">
        <view class="left" v-if="showLeft" @click="handleLeft">
          <text class="icon icon-back"></text>
          <text class="back-text" v-if="showLeftText">{{ leftText }}</text>
        </view>
        <view class="center">
          <text>{{ title }}</text>
        </view>
        <view class="right"></view>
      </template>
      <template v-else>
        <view class="logo">
          <image :src="src" />
        </view>
        <picker
          @change="handlePickerChange"
          :value="index"
          :range="range"
          :range-key="rangeKey"
        >
          <view class="yh-picker">{{ range[index][rangeKey] }}</view>
        </picker>
      </template>
    </view>
  </view>
</template>

<script>
/**
 * yhNavbar 自定义导航栏
 * @description 导航栏组件，主要用于头部导航
 * @property {String} title 标题文字
 */

import { getSystemInfo, navigateBack } from '@/common/utils/uniApi.js';

export default {
  name: 'yhNavbar',
  data() {
    return {
      bgiBase64:
        'data:image/png;base64,',

      systemInfo: {},
    };
  },
  props: {
    title: {
      type: [String],
      default: '',
    },
    showLeft: {
      type: [Boolean],
      default: false,
    },
    showLeftText: {
      type: [Boolean],
      default: false,
    },
    picker: {
      type: [Boolean],
      default: false,
    },
    index: {
      type: [Number],
      default: 0,
    },
    src: {
      type: [String],
      default: '',
    },
    range: {
      type: [Array],
      default: () => {
        return [];
      },
    },
    leftText: {
      type: [String],
      default: '返回',
    },
    showRight: {
      type: [Boolean],
      default: false,
    },
    rangeKey: {
      type: [String],
      default: '',
    },
    backgroundColor: {
      type: [String],
      default: '',
    },
    fixed: {
      type: [Boolean],
      default: false,
    },
  },
  created() {
    this.getUserSystemInfo();
  },
  mounted() {},
  methods: {
    // 获取用户设备信息
    getUserSystemInfo() {
      getSystemInfo().then(res => {
        this.systemInfo = Object.assign({}, res);
      });
    },
    handleLeft() {
      navigateBack(1);
      this.$emit('back');
    },
    handlePickerChange(e) {
      const index = e.detail.value;
      this.$emit('change', index);
    },
  },
  computed: {
    navbarWrapperStyle() {
      const data = this.systemInfo;
      const bgiBase64 = this.bgiBase64;
      const backgroundColor = this.backgroundColor;

      const { statusBarHeight } = data;

      let str = '';
      if (statusBarHeight) {
        str += `padding-top:${statusBarHeight}px;`;
        str += `height:${statusBarHeight + 44}px;`;
      }
      if (backgroundColor) {
        str += `background-color: ${backgroundColor};`;
      }
      if (bgiBase64 && !backgroundColor) {
        str += `background-image: url(${bgiBase64});`;
      }
      return str;
    },
  },
  watch: {},
};
</script>

<style scoped lang="scss">
@import '../../common/styles/scss/variable';
// iphone 6/7/8
$navbar-wrapper-height: 64px;
$navbar-content-height: 44px;
.yh-navbar-wrapper {
  width: 100%;
  min-height: $navbar-wrapper-height;
  padding-top: $navbar-wrapper-height - $navbar-content-height;
  position: relative;
  background-color: #c03a40;
  background-repeat: no-repeat;
  background-position: top left;
  background-size: 100%;
  &.fixed {
    position: absolute;
    top: 0;
    left: 0;
    z-index: 9999;
  }
}
.yh-navbar {
  width: 100%;
  height: $navbar-content-height;
  position: relative;
  display: flex;
  align-items: center;
  justify-content: flex-start;
  color: #fff;
  font-size: 18px;
  font-weight: 500;
  line-height: $navbar-content-height;
  transition: all 0.5s;
  &.picker {
    padding-left: 24rpx;
  }
  .left {
    position: absolute;
    left: 0;
    top: 50%;
    transform: translateY(-50%);
    display: flex;
    align-items: center;
    padding: 0 20rpx 0 30rpx;
    .icon-back {
      width: 8px;
      height: 14px;
      background: url(data:image/png;base64,)
        no-repeat top left;
      background-size: 100%;
    }
    .back-text {
      font-size: 14px;
      padding-left: 4px;
    }
  }
  .center {
    display: flex;
    width: 100%;
    padding: 0 100px;
    text {
      width: 100%;
      text-align: center;
      @include textOverflow();
    }
  }
  .right {
    position: absolute;
    right: 0;
    top: 50%;
    transform: translateY(-50%);
    display: flex;
    align-items: center;
    padding: 0 30rpx 0 20rpx;
  }
  .logo {
    width: 80rpx;
    height: 80rpx;
    display: flex;
    margin-right: 10rpx;
    image {
      width: 100%;
      height: 100%;
    }
  }
  .yh-picker {
    position: relative;
    padding-right: 16rpx;
    &::after {
      width: 12rpx;
      height: 8rpx;
      content: '';
      position: absolute;
      top: 50%;
      right: 0;
      transform: translateY(-50%);
      background: url(data:image/png;base64,)
        no-repeat top left;
      background-size: 100%;
    }
  }
}
</style>
